targets.expr:
sum by (gpu_type) (
  rate(ray_request_count{
    gpu_type=~"$gpu_type",
    workflow=~"$workflow",
    status=~"ok"
  }[1m])
) * 60

sum by (gpu_type) (
  rate(request_count_total{
    gpu_type=~"$gpu_type",
    workflow=~"$workflow",
    status=~"$status"
  }[1m])
) * 60

histogram_quantile($percentile, sum by (le, gpu_type) (
  rate(ray_execution_latency_bucket{
    gpu_type=~"$gpu_type",
    workflow=~"$workflow"
  }[$__rate_interval])
))

histogram_quantile($percentile, sum by (le, gpu_type) (
  rate(execution_latency_bucket{
    gpu_type=~"$gpu_type",
    workflow=~"$workflow"
  }[$__rate_interval])
))

sum by (gpu_type, workflow) (
  rate(ray_request_count{
    gpu_type=~"$gpu_type",
    workflow=~"$workflow",
    status=~"fail"
  }[1m])
) * 60

sum by (gpu_type, workflow) (
  rate(request_count_total{
    gpu_type=~"$gpu_type",
    workflow=~"$workflow",
    status=~"fail"
  }[1m])
) * 60

histogram_quantile($percentile, sum by (le, gpu_type) (
  rate(ray_request_latency_bucket{
    gpu_type=~"$gpu_type",
    workflow=~"$workflow"
  }[$__rate_interval])
))

histogram_quantile($percentile, sum by (le, gpu_type) (
  rate(request_latency_bucket{
    gpu_type=~"$gpu_type",
    workflow=~"$workflow"
  }[$__rate_interval])
))
